const subheadingsData = {
	1: [
		{
			title: "About Me",
			content: (
				<>
					<p>
						I am an Undergraduate Computer Science student with a strong grasp of coding and web technologies.
					</p>
					<hr />
					<p>
						I have spent 3+ years in competitive programming and 2+ years in tutoring University Students.
					</p>
					<hr />
					<p>
						Through hands-on projects, I have honed my skills in problem-solving and attention to detail.
					</p>
					<hr />
					<p>
						I am excited to bring my passion for software development and working on diverse technologies to a role, where I can continue learning and growing.
					</p>
				</>
			),
		},
	],
	2: [
		{
			title: "Bachelor's Degree",
			content: (
				<>
					<div>
						<h1 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '8px' }}>University of Saskatchewan</h1>
						<p style={{ marginBottom: '4px' }}>Sept 21 - Dec 22</p>
						<p style={{ marginBottom: '16px' }}>Bachelor of Science in Computer Science.</p>
						<hr />
						<h1 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '8px' }}>Concordia University</h1>
						<p style={{ marginBottom: '4px' }}>Jan 23 - Dec 25</p>
						<p style={{ marginBottom: '4px' }}>Bachelor of Computer Science in Computer Science. Specializing in Artificial Intelligence</p>
						<p style={{ marginBottom: '16px' }}>Credit Transfer from the University of Saskatchewan</p>
					</div>

				</>
			),
		},
		/**
		 * WRITE SOMETHING PROPER
		 */
		// {
		// 	title: "2014 Bachelors Degree",
		// 	content: (
		// 		<>
		// 			<p>
		// 				Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
		// 				eiusmod tempor incididunt ut labore et dolore magna aliqua.
		// 			</p>
		// 		</>
		// 	),
		// },
	],
	3: [
		{
			title: "Aug '23 - Present",
			content: (
				<>
					<h1 style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '8px' }}>Director of Community,</h1>
					<p style={{ marginBottom: '4px' }}>Hack Concordia</p>
					<p>
						Organized ConUHacks VIII, the largest hackathon in Quebec.
						Collaborated with the Tech team to maintain and enhance the ConUHacks and HackConcordia websites.
					</p>
				</>
			),
		},
		{
			title: "Jan'22 - Present",
			content: (
				<>
					<h1 style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '8px' }}>Online Tutor</h1>
					<p style={{ marginBottom: '4px' }}>Tutor Ocean, University of Saskatchewan</p>
					<p>
						Tailored teaching approaches for individual learning styles, measured through personalized written feedback and performance.
					</p>
				</>
			),
		},

		{
			title: "Aug '22 - Dec '22",
			content: (
				<>
					<h1 style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '8px' }}>Geek Squad Agent,</h1>
					<p style={{ marginBottom: '4px' }}>BestBuy</p>
					<p>
						Provided expert technical support to personal and enterprise clients, diagnosing and resolving software and hardware issues.
					</p>
				</>
			),
		},
	],
};

export default subheadingsData;
